INSERT INTO markdowns (id, "contentHTML", "contentMarkdown", "description", "doctorId", "specialtyId", "clinicId", "createdAt", "updatedAt") VALUES
(1, '<p>Nghề bác sĩ – một công việc cao quý nhưng cũng lắm truân chuyên bởi phải dày công khổ luyện mới có được vinh dự đứng trong hàng ngũ ngành Y. Bác sĩ không chỉ là người xoa dịu những niềm đau về tinh thần mà còn là những “thiên thần áo trắng” giành giật sự sống cho người bệnh bằng tài năng và sự tận tâm. Trước khi quyết định lựa chọn theo đuổi nghề bác sĩ hãy tham khảo thông tin chi tiết dưới đây.</p>', 'Nghề bác sĩ – một công việc cao quý nhưng cũng lắm truân chuyên bởi phải dày công khổ luyện mới có được vinh dự đứng trong hàng ngũ ngành Y. Bác sĩ không chỉ là người xoa dịu những niềm đau về tinh thần mà còn là những “thiên thần áo trắng” giành giật sự sống cho người bệnh bằng tài năng và sự tận tâm. Trước khi quyết định lựa chọn theo đuổi nghề bác sĩ hãy tham khảo thông tin chi tiết dưới đây.', 'Nghề bác sĩ – một công việc cao quý nhưng cũng lắm truân chuyên bởi phải dày công khổ luyện mới có được vinh dự đứng trong hàng ngũ ngành Y. Bác sĩ không chỉ là người xoa dịu những niềm đau về tinh thần mà còn là những “thiên thần áo trắng” giành giật sự sống cho người bệnh bằng tài năng và sự tận tâm. Trước khi quyết định lựa chọn theo đuổi nghề bác sĩ hãy tham khảo thông tin chi tiết dưới đây.', 15, NULL, NULL, '2024-08-19 00:58:30', '2024-08-19 00:58:30'),
(2, '<p><strong>Tiến sĩ, Bác sĩ Nguyễn Văn Doanh</strong></p>\n<ul>\n<li>\n<p>Trưởng khoa Khám bệnh, Bệnh viện Đa khoa Quốc tế Thu Cúc</p>\n</li>\n<li>\n<p>Nguyên chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị Việt Xô</p>\n</li>\n<li>\n<p>Bác sĩ có 40 năm kinh nghiệm làm việc chuyên khoa Nội Thần kinh</p>\n</li>\n<li>\n<p>Bác sĩ khám cho người bệnh từ 16 tuổi trở lên</p>\n</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>\n<p>Các bệnh đau đầu: Chứng đau nửa đầu, đau đầu căn nguyên mạch máu, đau đầu mạn tính hàng ngày,..</p>\n</li>\n<li>\n<p>Bệnh đau vai gáy do thoái hóa cột sống cổ, thoát vị đĩa đệm cột sống cổ, …</p>\n</li>\n<li>\n<p>Đau thắt lưng hông do thoái hóa, thoát vị, đau do viêm khớp cùng chậu…</p>\n</li>\n<li>\n<p>Rối loạn tiền đình</p>\n</li>\n<li>\n<p>Điều trị chóng mặt do thiếu máu não</p>\n</li>\n<li>\n<p>Tư vấn và điều trị các bệnh lý rối loạn về giấc ngủ: mất ngủ cấp tính hoặc mạn tính</p>\n</li>\n<li>\n<p>Liệt dây 7 ngoại vi: Viêm các dây thần kinh sọ não và các dây thần kinh ngoại vi khác như hội chứng ống cổ tay, đau vai khuỷu tay do chơi thể thao</p>\n</li>\n<li>\n<p>Liệt nửa người do nhồi máu não</p>\n</li>\n<li>\n<p>Các bệnh lý về sa sút trí tuệ: Suy giảm nhận thức nhẹ, suy giảm trí nhớ, sa sút trí tuệ nguyên nhân mạch máu (sa sút trí tuệ sau đột quỵ), Alzheimer</p>\n</li>\n<li>\n<p>Bệnh rối loạn vận động như bệnh Parkinson</p>\n</li>\n</ul>\n', '**Tiến sĩ, Bác sĩ Nguyễn Văn Doanh**\n\n* Trưởng khoa Khám bệnh, Bệnh viện Đa khoa Quốc tế Thu Cúc\n\n* Nguyên chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị Việt Xô\n\n* Bác sĩ có 40 năm kinh nghiệm làm việc chuyên khoa Nội Thần kinh\n\n* Bác sĩ khám cho người bệnh từ 16 tuổi trở lên\n\n**Khám và điều trị**\n* Các bệnh đau đầu: Chứng đau nửa đầu, đau đầu căn nguyên mạch máu, đau đầu mạn tính hàng ngày,..\n\n* Bệnh đau vai gáy do thoái hóa cột sống cổ, thoát vị đĩa đệm cột sống cổ, …\n\n* Đau thắt lưng hông do thoái hóa, thoát vị, đau do viêm khớp cùng chậu…\n\n* Rối loạn tiền đình\n\n* Điều trị chóng mặt do thiếu máu não\n\n* Tư vấn và điều trị các bệnh lý rối loạn về giấc ngủ: mất ngủ cấp tính hoặc mạn tính\n\n* Liệt dây 7 ngoại vi: Viêm các dây thần kinh sọ não và các dây thần kinh ngoại vi khác như hội chứng ống cổ tay, đau vai khuỷu tay do chơi thể thao\n\n* Liệt nửa người do nhồi máu não\n\n* Các bệnh lý về sa sút trí tuệ: Suy giảm nhận thức nhẹ, suy giảm trí nhớ, sa sút trí tuệ nguyên nhân mạch máu (sa sút trí tuệ sau đột quỵ), Alzheimer\n\n* Bệnh rối loạn vận động như bệnh Parkinson', 'Trưởng khoa Khám bệnh, Bệnh viện Đa khoa Quốc tế Thu Cúc\nNguyên chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị Việt Xô\nBác sĩ có 40 năm kinh nghiệm làm việc chuyên khoa Nội Thần kinh\nBác sĩ khám cho người bệnh từ 16 tuổi trở lên ', 17, NULL, NULL, '2024-08-20 10:36:32', '2024-08-20 10:36:32'),
(3, '<p><strong>Thạc sĩ, Bác sĩ Nguyễn Thị Kim Vi</strong></p>\n<ul>\n<li>\n<p>Giám đốc Phòng khám Chuyên khoa Nội An Phước</p>\n</li>\n<li>\n<p>Bác sĩ chuyên khoa Tiêu hóa - Gan mật - Nội soi tiêu hóa</p>\n</li>\n<li>\n<p>Bác sĩ nhận khám cho bệnh nhân từ 15 tuổi trở lên</p>\n</li>\n<li>\n<p>Hơn 15 năm công tác tại Bệnh viện Nhân dân 115</p>\n</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>\n<p>Hiện là Giám đốc Phòng khám Chuyên khoa Nội An Phước (2018 - nay)</p>\n</li>\n<li>\n<p>Bác sĩ điều trị, khoa Tiêu hóa, Bệnh viện Nhân dân 115 (2004 - 2018)</p>\n</li>\n<li>\n<p>Bác sĩ nội soi tiêu hóa, khoa Nội soi, Bệnh viện Nhân dân 115 (2004 - 2018)</p>\n</li>\n<li>\n<p>Bác sĩ luân khoa, Bệnh viện Nhân dân 115 (2003 - 2004)</p>\n</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>\n<p>Tốt nghiệp Thạc sĩ chuyên ngành Nội tổng quát, Đại học Y dược TPHCM (2012)</p>\n</li>\n<li>\n<p>Tốt nghiệp Bác sĩ đa khoa, Đại học Y khoa Phạm Ngọc Thạch (2002)</p>\n</li>\n<li>\n<p>Chứng chỉ Nội soi đại tràng, Bệnh viện Chợ Rẫy (2015)</p>\n</li>\n<li>\n<p>Chứng chỉ Nội soi dạ dày - tá tràng, Bệnh viện Nhân dân 115 (2014)</p>\n</li>\n<li>\n<p>Chứng chỉ Siêu âm tổng quát thực hành, Bệnh viện Đại học Y dược TPHCM (2005)</p>\n</li>\n<li>\n<p>Thành viên các Hội khoa học, tổ chức chuyên môn</p>\n</li>\n<li>\n<p>Hội Tiêu hóa - Gan mật</p>\n</li>\n</ul>\n<p><strong>Bác sĩ khám và điều trị:</strong></p>\n<ul>\n<li>\n<p>Viêm loét dạ dày: đau bụng, nôn ói, đầy bụng</p>\n</li>\n<li>\n<p>Viêm thực quản trào ngược: nghẹn, nuốt nghẹn, khó thở, ho kéo dài</p>\n</li>\n<li>\n<p>Nhiễm HP dạ dày: đau bụng, nôn ói, đầy bụng</p>\n</li>\n<li>\n<p>Loét thực quản: nuốt vướng</p>\n</li>\n<li>\n<p>Đầy bụng chưa rõ nguyên nhân: đầy, chướng bụng</p>\n</li>\n<li>\n<p>Đau bụng chưa rõ nguyên nhân: đau bụng</p>\n</li>\n<li>\n<p>Viêm đại tràng: rối loạn đi tiêu lúc táo bón lúc tiêu chảy</p>\n</li>\n<li>\n<p>Viêm ruột: đau bụng, tiêu lỏng, tiêu máu, sốt</p>\n</li>\n<li>\n<p>Hội chứng ruột kích thích: rối loạn đi tiêu lúc táo bón lúc tiêu chảy</p>\n</li>\n<li>\n<p>Bệnh Crohn: đau bụng, tiêu máu, sụt cân</p>\n</li>\n<li>\n<p>Rối loạn tiêu hoá: rối loạn đi tiêu</p>\n</li>\n<li>\n<p>Viêm gan siêu vi B tăng men gan, đầy bụng, vàng da, vàng mắt</p>\n</li>\n<li>\n<p>Viêm gan siêu vi C: có thể chưa có triệu chứng qua khám sức khoẻ</p>\n</li>\n<li>\n<p>Xơ gan do rượu: vàng da, vàng mắt, tiểu vàng</p>\n</li>\n<li>\n<p>Xơ gan do viêm gan siêu vi: vàng da, vàng mắt, tiểu vàng</p>\n</li>\n<li>\n<p>Viêm gan chưa rõ nguyên nhân: tăng men gan, ngứa, ăn kém</p>\n</li>\n<li>\n<p>Tăng men gan: tăng men gan, ngứa, ăn kém</p>\n</li>\n<li>\n<p>Dãn tĩnh mạch thực quản: tiêu phân đen, hoặc có tiền căn xơ gan trước đó</p>\n</li>\n<li>\n<p>Vàng da chưa rõ nguyên nhân: vàng da, vàng mắt, tiều vàng</p>\n</li>\n<li>\n<p>THA, Đái tháo đường</p>\n</li>\n</ul>\n<p><img src=\"https://vitaclinic.vn/storage/app/uploads/public/619/dde/b64/619ddeb648434917815749.jpg\" alt=\"img\"></p>\n', '**Thạc sĩ, Bác sĩ Nguyễn Thị Kim Vi**\n\n* Giám đốc Phòng khám Chuyên khoa Nội An Phước\n\n* Bác sĩ chuyên khoa Tiêu hóa - Gan mật - Nội soi tiêu hóa\n\n* Bác sĩ nhận khám cho bệnh nhân từ 15 tuổi trở lên\n\n* Hơn 15 năm công tác tại Bệnh viện Nhân dân 115\n\n**Quá trình công tác**\n\n* Hiện là Giám đốc Phòng khám Chuyên khoa Nội An Phước (2018 - nay)\n\n* Bác sĩ điều trị, khoa Tiêu hóa, Bệnh viện Nhân dân 115 (2004 - 2018)\n\n* Bác sĩ nội soi tiêu hóa, khoa Nội soi, Bệnh viện Nhân dân 115 (2004 - 2018)\n* Bác sĩ luân khoa, Bệnh viện Nhân dân 115 (2003 - 2004)\n\n**Quá trình đào tạo**\n* Tốt nghiệp Thạc sĩ chuyên ngành Nội tổng quát, Đại học Y dược TPHCM (2012)\n* Tốt nghiệp Bác sĩ đa khoa, Đại học Y khoa Phạm Ngọc Thạch (2002)\n\n* Chứng chỉ Nội soi đại tràng, Bệnh viện Chợ Rẫy (2015)\n* Chứng chỉ Nội soi dạ dày - tá tràng, Bệnh viện Nhân dân 115 (2014) \n* Chứng chỉ Siêu âm tổng quát thực hành, Bệnh viện Đại học Y dược TPHCM (2005)\n\n* Thành viên các Hội khoa học, tổ chức chuyên môn\n\n* Hội Tiêu hóa - Gan mật\n\n\n\n**Bác sĩ khám và điều trị:**\n\n* Viêm loét dạ dày: đau bụng, nôn ói, đầy bụng\n\n* Viêm thực quản trào ngược: nghẹn, nuốt nghẹn, khó thở, ho kéo dài\n\n* Nhiễm HP dạ dày: đau bụng, nôn ói, đầy bụng\n\n* Loét thực quản: nuốt vướng\n\n* Đầy bụng chưa rõ nguyên nhân: đầy, chướng bụng\n\n* Đau bụng chưa rõ nguyên nhân: đau bụng\n\n* Viêm đại tràng: rối loạn đi tiêu lúc táo bón lúc tiêu chảy\n\n* Viêm ruột: đau bụng, tiêu lỏng, tiêu máu, sốt\n* Hội chứng ruột kích thích: rối loạn đi tiêu lúc táo bón lúc tiêu chảy\n\n* Bệnh Crohn: đau bụng, tiêu máu, sụt cân\n* Rối loạn tiêu hoá: rối loạn đi tiêu\n* Viêm gan siêu vi B tăng men gan, đầy bụng, vàng da, vàng mắt\n* Viêm gan siêu vi C: có thể chưa có triệu chứng qua khám sức khoẻ\n* Xơ gan do rượu: vàng da, vàng mắt, tiểu vàng\n* Xơ gan do viêm gan siêu vi: vàng da, vàng mắt, tiểu vàng\n* Viêm gan chưa rõ nguyên nhân: tăng men gan, ngứa, ăn kém\n\n* Tăng men gan: tăng men gan, ngứa, ăn kém\n \n* Dãn tĩnh mạch thực quản: tiêu phân đen, hoặc có tiền căn xơ gan trước đó\n \n* Vàng da chưa rõ nguyên nhân: vàng da, vàng mắt, tiều vàng\n\n* THA, Đái tháo đường\n\n![img](https://vitaclinic.vn/storage/app/uploads/public/619/dde/b64/619ddeb648434917815749.jpg)', 'Giám đốc Phòng khám Chuyên khoa Nội An Phước\nBác sĩ chuyên khoa Tiêu hóa - Gan mật - Nội soi tiêu hóa\nHơn 15 năm công tác tại Bệnh viện Nhân dân 115\nBác sĩ nhận khám cho bệnh nhân từ 15 tuổi trở lên', 2, NULL, NULL, '2024-08-20 11:26:11', '2024-08-27 02:17:23'),
(4, '<p><strong>Tiến sĩ, Bác sĩ  Nguyễn Tấn Lộc</strong></p>\n<ul>\n<li>\n<p>Hơn 30 năm kinh nghiệm trong lĩnh vực Cơ xương khớp - Chấn thương chỉnh hình</p>\n</li>\n<li>\n<p>Từng công tác tại các bệnh viện lớn như: Bệnh viện Chợ Rẫy, Bệnh viện Chấn thương chỉnh hình\nTP.HCM, Bệnh viện Pháp Việt (FV)</p>\n</li>\n<li>\n<p>Giảng viên tại nhiều trường đại học y khoa nổi tiếng như: Đại học Y Dược TP.HCM, Đại học Y Phạm\nNgọc Thạch, khoa Y trường Đại học Quốc Gia TP.HCM,...</p>\n</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>\n<p>Chấn thương khớp gối, vai, cột sống (trong tai nạn sinh hoạt, chấn thương thể thao)</p>\n</li>\n<li>\n<p>Đứt dây chằng gối, dẹp rách sụn gối - trật khớp vai</p>\n</li>\n<li>\n<p>Chấn thương đứt dây chằng khớp gối</p>\n</li>\n<li>\n<p>Chấn thương rách đứt dây chằng cổ chân</p>\n</li>\n<li>\n<p>Chấn thương rách lật khớp vai</p>\n</li>\n<li>\n<p>Chấn thương rách gân khớp vai</p>\n</li>\n<li>\n<p>Thoái hóa khớp gối, cột sống cổ …</p>\n</li>\n<li>\n<p>Các bệnh lý đặc biệt trong thể thao</p>\n</li>\n<li>\n<p>Bệnh thoái hóa cột sống cổ tay đĩa đệm</p>\n</li>\n<li>\n<p>Bệnh lý khớp gối</p>\n</li>\n<li>\n<p>Hội chứng Tennis Elbow (viêm lồi cầu ngoài xương cánh tay là chấn thương thường gặp ở người chơi tennis)</p>\n</li>\n<li>\n<p>Gai gót chân</p>\n</li>\n<li>\n<p>Bệnh lý gối lệch trục xương ( vẹo trong , vẹo ngoài )</p>\n</li>\n<li>\n<p>Thoái hóa khớp háng</p>\n</li>\n</ul>\n<p><strong>Quá trình công tác</strong>\nHiện là Trưởng khoa Chấn thương chỉnh hình, Bệnh viện Quốc tế City (2013 - nay)</p>\n<p>Giảng viên bộ môn Chấn thương chỉnh hình, Đại học Y khoa Phạm Ngọc Thạch, Giảng viên bộ môn Ngoại – Khoa Y, Đại học Quốc gia TP.HCM (2013 - nay)</p>\n<p>Bác sĩ phẫu thuật Chấn thương chỉnh hình, Bệnh viện Pháp Việt (FV) (2002 - 2013)</p>\n<p>Bác sĩ điều trị khoa Chi dưới, Bệnh viện Chấn thương chỉnh hình TP.HCM (1993 - 2002)</p>\n<p>Bác sĩ điều trị khoa Chấn thương chỉnh hình, Bệnh viện Chợ Rẫy (1986 - 1993)</p>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>\n<p>Tốt nghiệp Bác sĩ tại Đại học Y dược TPHCM (1986)</p>\n</li>\n<li>\n<p>Tốt nghiệp Thạc sĩ chuyên ngành Chấn thương chỉnh hình, Đại học Y Dược TP.HCM (2002)</p>\n</li>\n<li>\n<p>Tốt nghiệp Tiến sĩ chuyên ngành Chấn thương chỉnh hình Đại học Y Dược TP.HCM (2011)</p>\n</li>\n<li>\n<p>Tốt nghiệp lớp đào tạo nội trú chuyên khoa Chấn thương chỉnh hình tại trường Đại học Y khoa Bordeaux 2, Pháp (1995)</p>\n</li>\n<li>\n<p>Bác sĩ nội trú khoa Chấn thương chỉnh hình Bệnh viện DAX, Bordeaux, Pháp (1995)\n<img src=\"https://raw.githubusercontent.com/haryphamdev/sharing-host-files/master/detail-doctors/a1.jpg\" alt=\"img\"></p>\n</li>\n</ul>\n', '**Tiến sĩ, Bác sĩ  Nguyễn Tấn Lộc**\n\n* Hơn 30 năm kinh nghiệm trong lĩnh vực Cơ xương khớp - Chấn thương chỉnh hình\n\n* Từng công tác tại các bệnh viện lớn như: Bệnh viện Chợ Rẫy, Bệnh viện Chấn thương chỉnh hình \n TP.HCM, Bệnh viện Pháp Việt (FV)\n\n* Giảng viên tại nhiều trường đại học y khoa nổi tiếng như: Đại học Y Dược TP.HCM, Đại học Y Phạm \n Ngọc Thạch, khoa Y trường Đại học Quốc Gia TP.HCM,...\n\n**Khám và điều trị**\n* Chấn thương khớp gối, vai, cột sống (trong tai nạn sinh hoạt, chấn thương thể thao)\n\n* Đứt dây chằng gối, dẹp rách sụn gối - trật khớp vai\n \n* Chấn thương đứt dây chằng khớp gối\n \n* Chấn thương rách đứt dây chằng cổ chân\n\n* Chấn thương rách lật khớp vai\n\n* Chấn thương rách gân khớp vai\n\n* Thoái hóa khớp gối, cột sống cổ …\n\n* Các bệnh lý đặc biệt trong thể thao\n\n* Bệnh thoái hóa cột sống cổ tay đĩa đệm\n\n* Bệnh lý khớp gối\n\n* Hội chứng Tennis Elbow (viêm lồi cầu ngoài xương cánh tay là chấn thương thường gặp ở người chơi tennis)\n\n* Gai gót chân\n\n* Bệnh lý gối lệch trục xương ( vẹo trong , vẹo ngoài )\n\n* Thoái hóa khớp háng\n\n**Quá trình công tác**\nHiện là Trưởng khoa Chấn thương chỉnh hình, Bệnh viện Quốc tế City (2013 - nay)\n\nGiảng viên bộ môn Chấn thương chỉnh hình, Đại học Y khoa Phạm Ngọc Thạch, Giảng viên bộ môn Ngoại – Khoa Y, Đại học Quốc gia TP.HCM (2013 - nay)\n\nBác sĩ phẫu thuật Chấn thương chỉnh hình, Bệnh viện Pháp Việt (FV) (2002 - 2013)\n\nBác sĩ điều trị khoa Chi dưới, Bệnh viện Chấn thương chỉnh hình TP.HCM (1993 - 2002)\n\nBác sĩ điều trị khoa Chấn thương chỉnh hình, Bệnh viện Chợ Rẫy (1986 - 1993)\n\n**Quá trình đào tạo**\n* Tốt nghiệp Bác sĩ tại Đại học Y dược TPHCM (1986)\n\n* Tốt nghiệp Thạc sĩ chuyên ngành Chấn thương chỉnh hình, Đại học Y Dược TP.HCM (2002)\n\n* Tốt nghiệp Tiến sĩ chuyên ngành Chấn thương chỉnh hình Đại học Y Dược TP.HCM (2011)\n\n* Tốt nghiệp lớp đào tạo nội trú chuyên khoa Chấn thương chỉnh hình tại trường Đại học Y khoa Bordeaux 2, Pháp (1995)\n\n* Bác sĩ nội trú khoa Chấn thương chỉnh hình Bệnh viện DAX, Bordeaux, Pháp (1995)\n![img](https://raw.githubusercontent.com/haryphamdev/sharing-host-files/master/detail-doctors/a1.jpg)', 'Hơn 30 năm kinh nghiệm trong lĩnh vực Cơ xương khớp - Chấn thương chỉnh hình\nTừng công tác tại các bệnh viện lớn như: Bệnh viện Chợ Rẫy, Bệnh viện Chấn thương chỉnh hình TP.HCM, Bệnh viện Pháp Việt (FV)\nGiảng viên tại nhiều trường đại học y khoa nổi tiếng như: Đại học Y Dược TP.HCM, Đại học Y Phạm Ngọc Thạch, khoa Y trường Đại học Quốc Gia TP.HCM,...', 19, NULL, NULL, '2024-08-20 11:46:12', '2024-08-20 11:54:47'),
(5, '<p><strong>Bác sĩ Chuyên khoa II Nguyễn Tường Vũ</strong></p>\n<ul>\n<li>\n<p>Nhiều năm kinh nghiệm trong khám và điều trị các bệnh lý Nội - Ngoại Thần kinh</p>\n</li>\n<li>\n<p>Hiện đang công tác tại Bệnh viện Chợ Rẫy và Bệnh viện Nhân dân 115</p>\n</li>\n<li>\n<p>Bác sĩ nhận khám từ 10 tuổi</p>\n</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>\n<p>Khám và điều trị các rối loạn:</p>\n</li>\n<li>\n<p>Đau nửa đầu</p>\n</li>\n<li>\n<p>Rối loạn tiền đình</p>\n</li>\n<li>\n<p>Parkinson</p>\n</li>\n<li>\n<p>Tai biến mạch máu não</p>\n</li>\n<li>\n<p>Đau dây thần kinh số V</p>\n</li>\n<li>\n<p>Viêm đa dây thần kinh</p>\n</li>\n<li>\n<p>Nhược cơ</p>\n</li>\n<li>\n<p>Liệt mặt</p>\n</li>\n<li>\n<p>Đau dây thần kinh liên sườn</p>\n</li>\n<li>\n<p>Hội chứng liệt nửa người</p>\n</li>\n<li>\n<p>Hội chứng mất trí nhớ thường xuyên</p>\n</li>\n</ul>\n<p><strong>Phẫu thuật bệnh lý ngoại biên:</strong></p>\n<ul>\n<li>\n<p>Máu tụ DMC (dưới màng cứng) mạn tính và các CTSN</p>\n</li>\n<li>\n<p>Ghép sọ tự thân, nhân tạo</p>\n</li>\n<li>\n<p>U da đầu lành tính</p>\n</li>\n</ul>\n', '**Bác sĩ Chuyên khoa II Nguyễn Tường Vũ**\n\n* Nhiều năm kinh nghiệm trong khám và điều trị các bệnh lý Nội - Ngoại Thần kinh\n\n* Hiện đang công tác tại Bệnh viện Chợ Rẫy và Bệnh viện Nhân dân 115\n\n* Bác sĩ nhận khám từ 10 tuổi\n\n\n**Khám và điều trị**\n\n* Khám và điều trị các rối loạn:\n\n* Đau nửa đầu\n\n* Rối loạn tiền đình\n\n* Parkinson\n\n* Tai biến mạch máu não\n\n* Đau dây thần kinh số V\n\n* Viêm đa dây thần kinh\n\n* Nhược cơ\n* Liệt mặt\n\n* Đau dây thần kinh liên sườn\n* Hội chứng liệt nửa người\n* Hội chứng mất trí nhớ thường xuyên\n\n**Phẫu thuật bệnh lý ngoại biên:**\n\n* Máu tụ DMC (dưới màng cứng) mạn tính và các CTSN\n\n* Ghép sọ tự thân, nhân tạo\n\n* U da đầu lành tính\n', 'Nhiều năm kinh nghiệm trong khám và điều trị các bệnh lý Nội - Ngoại Thần kinh\nHiện đang công tác tại Bệnh viện Chợ Rẫy và Bệnh viện Nhân dân 115\nBác sĩ nhận khám từ 10 tuổi ', 18, NULL, NULL, '2024-08-21 07:36:27', '2024-08-21 07:36:27'),
