INSERT INTO specialties (id, "nameVi", "nameEn", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(1, 'Cơ xương khớp', 'Muscle - Bone', '<h3><strong>Cơ Xương Khớp</strong></h3>\n<p><strong>Bác sĩ Cơ Xương Khớp giỏi</strong></p>\n<p>Danh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm</li>\n<li>Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li>\n</ul>\n<p><strong>Bệnh Cơ Xương Khớp</strong></p>\n<ul>\n<li>Gout</li>\n<li>Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ</li>\n<li>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</li>\n<li>Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai</li>\n<li>Loãng xương, đau nhức xương</li>\n<li>Viêm xương, gai xương</li>\n<li>Viêm cơ, Teo cơ, chứng đau mỏi cơ</li>\n<li>Yếu cơ, Loạn dưỡng cơ</li>\n<li>Các chấn thương về cơ, xương, khớp</li>\n<li>...</li>\n</ul>\n', '\n### **Cơ Xương Khớp**\n\n**Bác sĩ Cơ Xương Khớp giỏi**\n\n Danh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:\n\n* Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm\n* Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n\n**Bệnh Cơ Xương Khớp**\n\n* Gout\n* Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ\n* Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân\n* Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai\n* Loãng xương, đau nhức xương\n* Viêm xương, gai xương\n* Viêm cơ, Teo cơ, chứng đau mỏi cơ\n* Yếu cơ, Loạn dưỡng cơ\n* Các chấn thương về cơ, xương, khớp\n* ...', , '2024-08-31 00:45:29', '2024-08-31 00:45:29');
INSERT INTO specialties (id, "nameVi", "nameEn", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(2, 'Thần kinh', 'Mental', '<h3><strong>Thần kinh</strong></h3>\n<p><strong>Bác sĩ Thần kinh giỏi</strong></p>\n<p>Danh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:</p>\n<ul>\n<li>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.</li>\n</ul>\n<p><strong>Khám bệnh chuyên khoa Thần kinh</strong></p>\n<ul>\n<li>Bại Não</li>\n<li>Đau đầu, chóng mặt, buồn nôn</li>\n<li>Bệnh Pakison, bệnh tiền đình</li>\n<li>Bị co cơ, căng dây thần kinh</li>\n<li>Động kinh, có những cơn vãng ý thức</li>\n<li>Bị tê bì nửa mặt, chèn dây thần kinh</li>\n<li>Bồn chồn, lo lắng, hồi hộp, chân tay run</li>\n<li>Có dấu hiệu tăng động</li>\n<li>Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi</li>\n<li>Chấn thương đầu, dây thần kinh</li>\n<li>...</li>\n</ul>\n', '\n### **Thần kinh**\n\n\n**Bác sĩ Thần kinh giỏi**\n\nDanh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:\n\n* Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.\n\n**Khám bệnh chuyên khoa Thần kinh**\n* Bại Não	   \n* Đau đầu, chóng mặt, buồn nôn   \n* Bệnh Pakison, bệnh tiền đình	   \n* Bị co cơ, căng dây thần kinh	       \n* Động kinh, có những cơn vãng ý thức	   \n* Bị tê bì nửa mặt, chèn dây thần kinh\n* Bồn chồn, lo lắng, hồi hộp, chân tay run	   \n* Có dấu hiệu tăng động	    \n* Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi   \n* Chấn thương đầu, dây thần kinh\n* ...', , '2024-08-31 00:46:34', '2024-08-31 00:46:34');
INSERT INTO specialties (id, "nameVi", "nameEn", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(3, 'Tiêu hóa', 'Digestion', '<h3><strong>Tiêu hoá</strong></h3>\n<p><strong>Bác sĩ Chuyên khoa Tiêu hóa</strong></p>\n<p>Danh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội</li>\n<li>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...</li>\n</ul>\n<p><strong>Tư vấn, khám và điều trị các Bệnh Tiêu hóa</strong></p>\n<ul>\n<li>Ăn uống kém, không ngon</li>\n<li>Rối loạn tiêu hóa, táo bón, trĩ</li>\n<li>Nhiễm vi khuẩn HP (Helicobacter pylori)</li>\n<li>Nội soi dạ dày, đại tràng, tiêu hóa</li>\n<li>Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi</li>\n<li>Co thắt thực quản, Hội chứng ruột kích thích</li>\n<li>Đau bụng, dạ dày, đại tràng, thượng vị</li>\n<li>Viêm đại tràng, dạ dày, tá tràng</li>\n<li>Ung thư dạ dày, U nang tuyến tụy</li>\n<li>Bệnh lý về gan, mật</li>\n<li>...</li>\n</ul>\n', '\n### **Tiêu hoá**\n\n\n**Bác sĩ Chuyên khoa Tiêu hóa**\n\nDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:\n\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội\n* Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\n\n**Tư vấn, khám và điều trị các Bệnh Tiêu hóa**\n\n* Ăn uống kém, không ngon\n* Rối loạn tiêu hóa, táo bón, trĩ\n* Nhiễm vi khuẩn HP (Helicobacter pylori)\n* Nội soi dạ dày, đại tràng, tiêu hóa\n* Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi\n* Co thắt thực quản, Hội chứng ruột kích thích\n* Đau bụng, dạ dày, đại tràng, thượng vị\n* Viêm đại tràng, dạ dày, tá tràng\n* Ung thư dạ dày, U nang tuyến tụy\n* Bệnh lý về gan, mật\n* ...', , '2024-08-31 00:48:29', '2024-08-31 00:48:29');
INSERT INTO specialties (id, "nameVi", "nameEn", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(4, 'Tim mạch', 'Heart', '<h3><strong>Tim mạch</strong></h3>\n<p><strong>Bác sĩ tim mạch giỏi</strong></p>\n<p>Danh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.</li>\n<li>Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam</li>\n<li>Đạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li>\n</ul>\n<p><strong>Khám tư vấn tim mạch</strong></p>\n<ul>\n<li>Khó thở, Đau ngực, đau tim</li>\n<li>Tăng huyết áp, hạ huyết áp</li>\n<li>Rối loạn mỡ máu, cao huyết áp, chóng mặt</li>\n<li>Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ</li>\n<li>Cảm giác hồi hộp, tim đập nhanh</li>\n<li>Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến</li>\n<li>Đã đặt stent tim, nong động mạch vành</li>\n<li>Giãn tĩnh mạch chân</li>\n<li>...</li>\n</ul>\n', '\n### **Tim mạch**\n\n\n**Bác sĩ tim mạch giỏi**\n\nDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:\n* Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.\n* Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam\n* Đạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n\n**Khám tư vấn tim mạch**\n\n* Khó thở, Đau ngực, đau tim\n* Tăng huyết áp, hạ huyết áp\n* Rối loạn mỡ máu, cao huyết áp, chóng mặt\n* Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ\n* Cảm giác hồi hộp, tim đập nhanh	   \n* Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến	   \n* Đã đặt stent tim, nong động mạch vành\n* Giãn tĩnh mạch chân	   \n* ...', , '2024-08-31 00:49:51', '2024-08-31 00:49:51');
INSERT INTO specialties (id, "nameVi", "nameEn", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(5, 'Tai mũi họng', 'Ears-Eyes-Throat', '<h3><strong>Tai Mũi Họng</strong></h3>\n<p><strong>Bác sĩ Chuyên khoa Tai Mũi Họng</strong></p>\n<p>Danh sách các bác sĩ uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội</li>\n<li>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...</li>\n</ul>\n<p><strong>Các bệnh Tai Mũi Họng</strong></p>\n<ul>\n<li>Ù tai, đau tai, chảy máu tai</li>\n<li>Thủng màng nhĩ, điếc đột ngột</li>\n<li>Viêm tai giữa</li>\n<li>Amidan, V.A</li>\n<li>Viêm xoang</li>\n<li>Nghẹt mũi</li>\n<li>Hay bị chảy máu cam</li>\n<li>Đau cổ họng, khó nuốt</li>\n<li>Ho kéo dài</li>\n<li>Ngủ ngáy</li>\n<li>...</li>\n</ul>\n', '\n### **Tai Mũi Họng**\n\n\n**Bác sĩ Chuyên khoa Tai Mũi Họng**\n\nDanh sách các bác sĩ uy tín đầu ngành tại Việt Nam:\n\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội\n* Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...\n\n**Các bệnh Tai Mũi Họng**\n* Ù tai, đau tai, chảy máu tai\n* Thủng màng nhĩ, điếc đột ngột\n* Viêm tai giữa\n* Amidan, V.A\n* Viêm xoang\n* Nghẹt mũi\n* Hay bị chảy máu cam\n* Đau cổ họng, khó nuốt\n* Ho kéo dài\n* Ngủ ngáy\n* ...', , '2024-08-31 00:51:08', '2024-08-31 00:51:08');
INSERT INTO specialties (id, "nameVi", "nameEn", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(6, 'Cột sống', 'Spine', '<h3><strong>Cột sống</strong></h3>\n<p><strong>Bác sĩ Chuyên khoa Cột sống</strong></p>\n<p>Danh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội</li>\n<li>Các giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.</li>\n<li>Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li>\n</ul>\n<p><strong>Bệnh Thần kinh - Cột sống</strong></p>\n<ul>\n<li>Đau cột sống, đau thắt lưng</li>\n<li>Chấn thương cột sống</li>\n<li>Cột sống bị đau, sưng, cong, vẹo</li>\n<li>Đau mỏi cổ vai gáy, bả vai</li>\n<li>Đau tê mông xuống chân</li>\n<li>Phồng đĩa đệm</li>\n<li>Tê bì tay chân</li>\n<li>Thóa hóa đốt sống</li>\n<li>Thoái hóa L4, L5</li>\n<li>Thoát vị đĩa đệm</li>\n<li>Vôi hóa cột sống</li>\n<li>Xẹp cột sống</li>\n<li>...</li>\n</ul>\n', '\n### **Cột sống**\n\n\n**Bác sĩ Chuyên khoa Cột sống**\n\nDanh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.\n\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội\n* Các giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.\n* Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n\n**Bệnh Thần kinh - Cột sống**\n\n* Đau cột sống, đau thắt lưng\n* Chấn thương cột sống\n* Cột sống bị đau, sưng, cong, vẹo\n* Đau mỏi cổ vai gáy, bả vai\n* Đau tê mông xuống chân\n* Phồng đĩa đệm\n* Tê bì tay chân\n* Thóa hóa đốt sống\n* Thoái hóa L4, L5\n* Thoát vị đĩa đệm\n* Vôi hóa cột sống\n* Xẹp cột sống\n* ...', , '2024-08-31 00:52:01', '2024-08-31 00:52:01');
INSERT INTO specialties (id, "nameVi", "nameEn", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(7, 'Y học cổ truyền', 'Indigenous medicine ', '<p><strong>Y học Cổ truyền</strong></p>\n<p><strong>Bác sĩ Y học Cổ truyền giỏi</strong></p>\n<p>Danh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền</li>\n<li>Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..</li>\n</ul>\n<p><strong>Tư vấn, khám và điều trị các vấn đề:</strong></p>\n<ul>\n<li>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...</li>\n<li>Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...</li>\n<li>Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...</li>\n<li>Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</li>\n</ul>\n', '**Y học Cổ truyền**\n\n**Bác sĩ Y học Cổ truyền giỏi**\n\nDanh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\n* Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\n\n**Tư vấn, khám và điều trị các vấn đề:**\n\n* Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\n* Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\n* Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\n* Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', , '2024-08-31 00:53:12', '2024-08-31 00:53:12');
INSERT INTO specialties (id, "nameVi", "nameEn", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(8, 'Châm cứu', 'Acpuncture', '<h3><strong>Châm cứu</strong></h3>\n<p><strong>Bác sĩ Châm cứu giỏi</strong></p>\n<p>Bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền</li>\n<li>Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..</li>\n</ul>\n<p><strong>Tư vấn, khám và điều trị các vấn đề:</strong></p>\n<ul>\n<li>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...</li>\n<li>Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...</li>\n<li>Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...</li>\n<li>Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</li>\n</ul>\n', '\n### **Châm cứu**\n\n\n**Bác sĩ Châm cứu giỏi**\n\nBác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:\n\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\n* Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\n\n**Tư vấn, khám và điều trị các vấn đề:**\n\n* Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\n* Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\n* Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\n* Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', , '2024-08-31 00:54:17', '2024-08-31 00:54:17');
INSERT INTO specialties (id, "nameVi", "nameEn", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(9, 'Sản phụ khoa', 'Obstetrics', '<p><strong>Sản Phụ khoa</strong></p>\n<p><strong>Bác sĩ Sản phụ khoa</strong></p>\n<p>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản giỏi tại Hà Nội.</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Sản phụ khoa tại Hà Nội</li>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Rối loạn kinh nguyệt, chậm kinh, đau bụng kinh</li>\n<li>Tắc hai vòi trứng, Đa nang buồng trứng, Chụp vòi trứng,</li>\n<li>Khám hiếm muộn, vô sinh</li>\n<li>Khám Phụ Khoa</li>\n<li>Khám thai sản</li>\n<li>Khám tiền hôn nhân, Tiền sinh</li>\n<li>Kiểm tra phụ khoa</li>\n<li>Loạn dưỡng vú</li>\n<li>Rong kinh kéo dài</li>\n<li>Siêu âm thai định kỳ</li>\n<li>Thai lưu</li>\n<li>U xơ tử cung, Viêm lộ tuyến</li>\n<li>...</li>\n</ul>\n', '**Sản Phụ khoa**\n\n**Bác sĩ Sản phụ khoa**\n\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản giỏi tại Hà Nội.\n\n*  Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Sản phụ khoa tại Hà Nội\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.\n\n**Khám và điều trị**\n\n\n* Rối loạn kinh nguyệt, chậm kinh, đau bụng kinh   \n* Tắc hai vòi trứng, Đa nang buồng trứng, Chụp vòi trứng, 	      \n* Khám hiếm muộn, vô sinh	   \n* Khám Phụ Khoa	   \n* Khám thai sản	   \n* Khám tiền hôn nhân, Tiền sinh	   \n* Kiểm tra phụ khoa	   \n* Loạn dưỡng vú	   \n* Rong kinh kéo dài	   \n* Siêu âm thai định kỳ	   \n* Thai lưu\n* U xơ tử cung, Viêm lộ tuyến\n* ...', , '2024-08-31 00:55:37', '2024-08-31 00:55:37');
INSERT INTO specialties (id, "nameVi", "nameEn", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(10, 'Ngoại thần kinh', 'Neurosurgery', '<h3><strong>Ngoại thần kinh</strong></h3>\n<p><strong>Bác sĩ Ngoại Thần kinh giỏi</strong></p>\n<p>Danh sách các giáo sư, bác sĩ chuyên khoa Ngoại Thần kinh giỏi:</p>\n<ul>\n<li>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Ngoại Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện 108, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện Đại học Y Hà Nội...</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.</li>\n</ul>\n<p><strong>Khám bệnh chuyên khoa Ngoại Thần kinh</strong></p>\n<ul>\n<li>U não</li>\n<li>Bệnh lý về chấn thương sọ não</li>\n<li>Não úng thủy</li>\n<li>Đau dây thần kinh</li>\n<li>Dị dạng động tĩnh mạch</li>\n<li>Dị dạng mạch máu não</li>\n<li>Túi phình mạch máu não</li>\n<li>Khuyết sọ</li>\n<li>U dây thần kinh ngoại biên</li>\n<li>...</li>\n</ul>\n', '\n### **Ngoại thần kinh**\n\n\n**Bác sĩ Ngoại Thần kinh giỏi**\n\nDanh sách các giáo sư, bác sĩ chuyên khoa Ngoại Thần kinh giỏi:\n\n* Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Ngoại Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện 108, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện Đại học Y Hà Nội...\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.\n\n**Khám bệnh chuyên khoa Ngoại Thần kinh**\n* U não\n* Bệnh lý về chấn thương sọ não\n* Não úng thủy\n* Đau dây thần kinh\n* Dị dạng động tĩnh mạch\n* Dị dạng mạch máu não\n* Túi phình mạch máu não\n* Khuyết sọ\n* U dây thần kinh ngoại biên\n* ...', , '2024-08-31 00:56:43', '2024-08-31 00:56:43');
